import { useSpring, animated, useInView } from '@react-spring/web';
import * as React from 'react';
import { Grid, Typography, Link } from "@mui/material";
import image1 from './images/image1.png';
import image2 from './images/image2.png';
import image4 from './images/image4.png';
import image5 from './images/image5.png';
import video1 from './videos/video1.gif';
import video2 from './videos/video2.gif';
import video3 from './videos/video3.gif';

import PropTypes from 'prop-types';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';

const GifsData = [
  {
    img: video1,
    desc: '',
  },
  {
    img: video2,
    desc: '',
  },
  {
    img: video3,
    desc: '',
  }
]
const itemData = [
  {
    img: image1,
    desc: 'biggest size maze as a 30x30',
  },
  {
    img: image2,
    desc: 'After the computer found the solution',
  },
  {
    img: image4,
    desc: 'the medium-sized maze at 20x20',
  },
  {
    img: image5,
    desc: 'the second colour pallet option',
  }];

  function CustomTabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  CustomTabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
  };

  function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  }

function MazeGame() {
  /*
  const [ref1, inView1] = useInView();
  const [ref2, inView2] = useInView();
  const [ref3, inView3] = useInView();
  const [ref4, inView4] = useInView();

  const shows = [
    useSpring({
      from: { opacity: 0 },
      to: { opacity: inView1 ? 1 : 0 },
      config: { duration: 2000 },
    }),
    useSpring({
      from: { opacity: 0 },
      to: { opacity: inView2 ? 1 : 0 },
      config: { duration: 2000 },
    }),
    useSpring({
      from: { opacity: 0 },
      to: { opacity: inView3 ? 1 : 0 },
      config: { duration: 2000 },
    }),
    useSpring({
      from: { opacity: 0 },
      to: { opacity: inView4 ? 1 : 0 },
      config: { duration: 2000 },
    }),
  ];*/
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <>
      <div style={{ textAlign: 'center' }}>
        <h1>MAZE GAME</h1>
        <Typography>
          Using the SDL library with C++ I was able to design and develop a maze game. This maze game allows you to regenerate a new maze with just a click of a button. There are 3 maze sizes to choose from, a 12x12, a 20x20, and a 30x30 maze size. In addition, you can change the color palette from a blue/white layout to a green/black one. Lastly, if you get stuck you can click the "solve" button and the computer will show you how to complete the maze! If you want to look at how the program looks like you can check out the screenshots and gifs below.
        </Typography>
        <Link href="https://github.com/TheRealJasoandRazi/Maze_Game" target="_blank" rel="noopener noreferrer">
          Source Code Here
        </Link>
        <h3>ScreenShots</h3>
      </div>

      <Box sx={{ width: '100%' }}>
  <Box sx={{ borderBottom: 1, borderColor: 'divider'}}>
    <Tabs value={value} onChange={handleChange} aria-label="basic tabs example" >
      {itemData.map((item, index) => (
        <Tab key={index} label={`Screenshot ${index+1}`} {...a11yProps(index)} sx={{color: 'white'}} />
      ))}
    </Tabs>
  </Box>

  {itemData.map((item, index) => (
    <CustomTabPanel key={index} value={value} index={index}>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <img
            src={item.img}
            alt={`Item ${index + 1}`}
            style={{
              width: '100%',
              height: '100%',
              objectFit: 'fill',
            }}
            loading="lazy"
          />
        </Grid>
        <Grid item xs={12} md={6}>
          <Typography>{item.desc}</Typography>
        </Grid>
      </Grid>
    </CustomTabPanel>
  ))}
</Box>

