              ref={eval(`ref${index + 1}`)}
              style={{
                width: '100%',
                height: '100%',
                background: 'black',
                borderRadius: 8,
                ...shows[index],
                alignContent: 'center',
                textAlign: 'center',
                overflow: 'hidden',
              }}
